window.bookSummaryJSON = "<p><b>The Expeditionary Force saga continues with </b><b><i>Breakaway</i></b><b>, the eagerly awaited sequel to number-one Audible-ranked and </b><b><i>New York Times</i></b><b> best-selling </b><b><i>Brushfire</i></b><b>, from an epic sci-fi writer at the top of his game. Join the millions of listeners who have enjoyed R.C. Bray’s hilarious portrayal of Joe, Skippy, The Merry Band of Pirates, and so many other unforgettable characters. </b></p> <p>The Merry Band of Pirates offered the bad guys a ceasefire. We won’t mess with them, if they don’t mess with us. Easy, right?&nbsp;</p> <p><b><i>No. </i></b></p> <p>The aliens chose to do things the hard way. So, the Pirates are racing around the galaxy to clean up the threat to Earth. The infant UN Navy has their own mission with the Alien Legion: Get humanity some allies in the fight. And the Ethics &amp; Compliance Office might have to do something...ethical. Unless they can find a way around it.</p>"; 
